import { Component, OnInit } from '@angular/core';
import { FormControl, FormGroup } from '@angular/forms';
import { FornecedoresService } from 'src/app/FornecedorServico/fornecedores.service';
import { Fornecedor } from 'src/app/Model/Fornecedor';
import { Router } from '@angular/router';

@Component({
  selector: 'app-fornecedores',
  templateUrl: "./fornecedores.component.html",
  styleUrls: ['./fornecedores.component.css']
})
export class ClientesComponent implements OnInit {
  formulario: any;
  tituloFormulario: string = '';  
  constructor(private clientesService : FornecedoresService, private router : Router) { }

  ngOnInit(): void {
  this.tituloFormulario = 'Novo Cliente';
  this.formulario = new FormGroup({
  cnpj: new FormControl(null),
  nome: new FormControl(null)
  })
  }

  enviarFormulario(): void {
  const cliente : Fornecedor = this.formulario.value;
  this.clientesService.cadastrar(cliente).subscribe(result => {
  alert('Cliente inserido com sucesso.');
  this.router.navigate(["/home"]);
  })
  }
  }
